const GetMobileNumber=(text)=>{
    text =(text.replace(/([+]?\d{1,2}?)?(\d{3}?){2}\d{5}/g,''))
    return(
    <div style={{ whiteSpace: 'nowrap' }} className="bg-dark">{text}</div>
    )
  }
  export default GetMobileNumber;
